import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate hook
import Header from './Header';
import Sidebar from '../Components/Sidebar/index'; // Corrected typo here from 'SidbarSuber' to 'Sidebar'

const SuperAdminDashboard = ({ setIsAuthenticated }) => {
  const navigate = useNavigate(); // Use the hook to get the navigate function

  const handleLogout = () => {
    sessionStorage.removeItem('token');
    setIsAuthenticated(false);
    navigate('/login');
  };

  return (
    
    <div>
      <Header />
      <h1>SuperAdmin Dashboard</h1>
      <Sidebar />
      <button onClick={handleLogout}>Logout</button> {/* Add a button to trigger logout */}
    </div>
  );
};

export default SuperAdminDashboard;
